    // https://leetcode.com/problems/climbing-stairs/description/
    int ClimbStairs(int n)
    {
        if (n == 1)
            return 1;

        if (n == 2)
            return 2;

        var previous = 1;
        var current = 2;

        var i = 2;
        while (i < n)
        {
            var temp = current;
            current += previous;
            previous = temp;
            i++;
        }

        return current;
    }
}

