    int WiggleMaxLength(int[] nums)
    {
        if (nums.Length == 1)
            return 1;

        var result = 0;
        var prevDiff = nums[1] - nums[0];

        result = prevDiff != 0 ? 2 : 1;

        for (int i = 2; i < nums.Length; i++)
        {
            var curDiff = nums[i] - nums[i - 1];
            if (curDiff < 0 && prevDiff >= 0 ||
                curDiff > 0 && prevDiff <= 0)
            {
                result++;
                prevDiff = curDiff;
            }
        }

        return result;
    }
}

