    int FindTargetSumWays(int[] nums, int target)
    {
        var set = new List<int>(nums.Length * 2) { 0 };

        foreach (var num in nums)
        {
            var cur = set.ToArray();
            set.Clear();

            foreach (var i in cur)
            {
                set.Add(i + num);
                set.Add(i - num);
            }
        }

        return set.Count(i => i == target);
    }
}

