    int CombinationSum4(int[] nums, int target)
    {
        var dp = new int[target + 1];

        for (var i = 1; i <= target; i++)
        {
            foreach (var num in nums)
            {
                if (num > i)
                    continue;

                if (num == i)
                    dp[i]++;

                dp[i] += dp[i - num];
            }
        }

        return dp[target];
    }
}

